import "./App.css";
import Nav from "./nav";
import { BrowserRouter, Route, Routes } from "react-router-dom";

function App() {
  return (
    <div className="App">
      <BrowserRouter>
        <Nav />
        <Routes>
          <Route path="/" element={<h1>All Products</h1>} />
          <Route path="/add" element={<h1>Add Products</h1>} />
          <Route path="/update" element={<h1>Update Products</h1>} />
        </Routes>
      </BrowserRouter>
      <footer></footer>
    </div>
  );
}

export default App;
